bool reduced_classical_pl_known(size_t N) {
    return CLASSICAL_PLS.find(N) != CLASSICAL_PLS.end();
}


const pl_type& reduced_classical_pl(size_t N) {
    ASSERT(N > 0);

    static CacheT<size_t, pl_type> cache;
    if (cache.contains(N)) {
        return cache[N];
    }

    auto pl_half = CLASSICAL_PLS.find(N);
    if (pl_half == CLASSICAL_PLS.end()) {
        throw BadValue("reduced_classical_pl: unknown N=" + std::to_string(N), Here());
    }

    ASSERT(pl_half->second.size() == N);

    pl_type pl(N * 2);

    auto p = pl_half->second.begin();
    for (size_t i = 0, j = 2 * N - 1; i < N; ++i, --j) {
        pl[i] = pl[j] = *p++;
    }

    return (cache[N] = std::move(pl));
}


